  <div className="grid">
      <Nav />
      <article className="article1">
          <h1>Le site</h1>
          <p></p>
      </article>
      <br />
      <article className="article2">
          <h1>JK Rowling</h1>
          <img src={jkr} alt="Photo de JKRowling"/>
          <p></p>
      </article>
  </div>
  )}

export default Accueil;
